import React, { Component } from 'react';

class Bench extends Component {
    constructor(props) {
        super(props)
        this.state = {
            input: 0,

        }
    }
    render() {
        return (
            <div>
                Bench: {this.state.input}
            </div>
        )
    }
}

export default Bench
